import './style/index.css';
import ImageEditor from './components/ImageEditor';

const App = ({ props }) => {

    return (
        props.map((item, index) => {
            return (
                <div>
                    <ImageEditor key={index} props={item} />
                    <div> {index} </div>
                </div>
            )
        })

    );
}

export default App;
